import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import StartScreen from "./page/StartScreen";
import Home from "./page/Home";

function App() {
    return (
        <>
            <BrowserRouter>
                <Routes>
                    <Route path={"/"} element={<StartScreen/>}/>
                    <Route path={"/"} element={<Home/>}/>

                </Routes>
            </BrowserRouter>
        </>
    );
}

export default App;
